import React from 'react';
import classes from './Permanent_main.module.css';
import {NavLink} from "react-router-dom";
import KenguruIcons from "../../common/svgImg/kenguruIcons";
import KenguruText from "../../common/svgImg/kenguruText";
const Permanent_main=(props)=>{
        return <div className={classes.main_block}>
                    <div className={classes.img_logo}>
                        <KenguruIcons/>
                        <KenguruText/>
            </div>
            <div className={classes.switch}>
                        <NavLink exact to={'/express'} activeClassName={classes.active} className={classes.active_switch}>
                                Экспресс
                        </NavLink>
                        <NavLink to={'/cargo'} activeClassName={classes.active} className={classes.active_switch}>
                                Карго
                        </NavLink>
                    </div>
            <div className={classes.actions}>
                        <div>
                            <a href={'tel:+78006004044'}>8-800-600-40-44</a>
                        </div>
                        <div>
                            Личный кабинет
                        </div>
                    </div>
        </div>
    };
export default Permanent_main;
